import React from "react";
import "./style.css";

function Hero(props) {
  return (
    <div className="jumbotron text-center" id="coolColor"  style={{ backgroundImage: `url(${props.backgroundImage})` }}>

      {props.children}
    </div>
  );
}

export default Hero;
